const inlineStyle = {
background: '#fff',
left: '50%',
top: '50%',
position: 'absolute',
padding: '20px',
transform : 'translate(-50%,-50%)',


}

class Home extends Component {

    render(){
        return(
            <div style={{ textAlign: 'center' }}>
            <Parallax bgImage={ image1 } strength={500}>
                <div className="banner">
                <div style={inlineStyle}>HTM INSIDE Parallax</div>
                </div>

            </Parallax>
            </div>
        )
    }

}


export default Home;
